import React from 'react';

import DetailsPokemon from './DetailsPokemon.js'



class Pokemon extends React.Component {
    render() {
        const pokemons = this.props.pokemon

        return (
            <div>
                <span>
                    {pokemons.id}
                </span>
                <DetailsPokemon pokemon={pokemons} />
            </div>
        )
    }
}

export default Pokemon;
